import React from "react";
import "./style.css";
import DropDownMenu from "components/DropDownMenu/DropDownMenu";
import { useLocation } from "react-router-dom";

export default function OrderchemotherapyPage() {
  const location = useLocation();
  const initialSelectedOption =
    location.state?.newRegimenDetails?.regimenName || "none";

  return (
    <div className="order-container mx-auto">
      <div className="text-wrapper-5">Select regimen</div>
      <DropDownMenu initialSelectedOption={initialSelectedOption} />
    </div>
  );
}
